import React from "react";
import Book from "./Book";
import Form from "./Form";

function Home({books, onAddToCart}) {
    return (
        <>
            <Form />
            {books.map((book) => {
                return <Book key={book.id} book={book} onAddToCart={onAddToCart}/>
            })}
        </>
    )
}

export default Home;
